pragma solidity >=0.7.0 <0.9.0;

contract SumItUp {    
  int public balance = 4500; // Создайте переменную balance, равную 4500;
  int public comission = -10; // Создайте переменную commission, равную -10;

  function sum() view public returns (int){
    int total = balance + comission; // Создайте переменную total, равную сумме баланса и комиссии;
    return total;
  }
}

